import React, { Component } from 'react'
import Grid from '@material-ui/core/Grid';
import axios from 'axios';
class home extends Component {
    componentDidMount(){
        axios.get()
    }
    render() {
        return (
            <Grid container spacing={16}>
                <Grid item sm={8} xs={12}>
                    <p>hello</p>
                </Grid>
                <Grid item sm={4} xs={12}>
                    <p>hello</p>
                </Grid>
            </Grid> 
        );
    }
}

export default home
